import React from 'react';
import { View } from 'react-native';

const Bird = ({bird}) => {
  return (
    <View
      style={{
        position: 'absolute',
        backgroundColor: 'blue',
        width: 50,
        height: 60,
      }}
    />
  );
};

export default Bird;
